Add in more isometrics to your training.

In this video, I'm performing an Isometric version of a shoulder press. Instead of performing the full lift, I'm pushing hard into the initial range of motion.

This is a type of contraction where little to no actual motion is occurring, but we still get a lot of muscle engagement.

This places less stretch/lengthening on the muscle and less force overall on any tissues that may be injured.

Exercises like this are GREAT for decreasing pain, helping to get blood flow to the area and for continuing to train muscle groups or movements that you may be having issues with.

These will also make you strong, even if you arent in pain.

You could apply this to squats, lifts from the floor, pullups, pretty much anything..with enough creativity.";}i:56;a:1:{s:14:"comments_count";i:2;}i:57;a:1:{s:11:"likes_count";i:2;}i:58;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuguG6DABJ";}i:59;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118769414_945130945956331_7269754072392151657_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=107&_nc_ohc=6WvuK4RaMnwAX-04y0M&_nc_tp=18&oh=aa356712410a74f7bcf87f1ed226bc92&oe=5F550B4F";}i:60;a:1:{s:4:"type";s:5:"video";}i:61;a:1:{s:8:"owner_id";i:2860647330;}i:62;a:1:{s:14:"owner_username";s:0:"";}i:63;a:1:{s:14:"owner_fullname";s:0:"";}i:64;a:1:{s:9:"owner_pic";s:0:"";}i:65;a:1:{s:2:"id";s:19:"2390986980537169115";}i:66;a:1:{s:10:"short_code";s:11:"CEuff2lgHTb";}i:67;a:1:{s:12:"created_time";i:1599248449;}i:68;a:1:{s:7:"caption";s:275:"Body Itchingüï∫üèæ @dahlingage1 
